import { ProductCard } from "./ProductCard";

interface Variants {
  price: number
}

interface Items {
  description: string,
  name: string,
  variants: Variants[]
}

interface ProductData {
  products: Items[]
}


export const ProductList = (data: ProductData[]): JSX.Element => {
  return (
    <section>
      {
        data && data.map(() => {
          return (
            <ProductCard {...data}></ProductCard>
          )
        })
      }
    </section>
  );
}
